$(document).ready(function(){$(".owl-carousel").owlCarousel({loop:!0,nav:!1,dots:!0,items:1,autoplay:!0}),$("#menu_button").click(function(){return $("#sp_menu").slideToggle(),!1}),$(".thumb-item img").click(function(){if(!$(this).hasClass("gray")){var t=$(this).attr("src");$(".main img").attr("src",t)}})});